import Link from 'next/link';
import Head from 'next/head';
export default () => (
  <div>
    <Head>
      <title>My styled page</title>
    </Head>
    <p className={styles.hello}>Hello World</p>
    <Link href='/about'>
      <a>About</a>
    </Link>
  </div>
)

var styles = {
  hello: {
    color: 'red'
  }
}
